return ['domain'=>NULL,'plural-forms'=>'nplurals=2; plural=(n != 1);','language'=>'et_EE','pot-creation-date'=>'2025-09-04 10:01-0500','po-revision-date'=>'2025-09-04 10:01-0500','translation-revision-date'=>'2025-09-04 10:01-0500','project-id-version'=>'ICS Calendar','x-generator'=>'Poedit 3.7','messages'=>['%1$sYou are running ICS Calendar in a WordPress Playground implementation.%2$s Because ICS Calendar is intended to run on a web server, some features may be unavailable or may not function properly.'=>'%1$sSa käivitad ICS Calendar\'i WordPress Playgroundi rakenduses.%2$s Kuna ICS Calendar on mõeldud kasutamiseks veebiserveris, võivad mõned funktsioonid olla kättesaamatud või ei pruugi korralikult toimida.','%1$sYour site is currently using a UTC offset-based timezone setting.%2$s This can produce time display errors in the %3$s plugin in locations that observe Daylight Saving Time. Please %4$schange your timezone setting%5$s to the city nearest your location, in the same timezone, for proper time display. See our %6$sdocumentation%7$s for additional information on this issue.'=>'%1$sTeie sait kasutab praegu UTC-nihke ajavööndi seadistust.%2$s See võib tekitada aja kuvamise vigu %3$s pluginas kohtades, kus järgitakse suveaega. Palun %4$s muutke oma ajavööndi seade %5$s teie asukohale lähima linna jaoks, mis asub samas ajavööndis, et aeg oleks õigesti kuvatud. Lisateavet selle probleemi kohta leiate meie %6$sdokumentatsioonist%7$s.','Utilities'=>'Tööriistad','Settings'=>'Seaded','User Guide'=>'Kasutusjuhend','Support'=>'Tugi','Upgrade to PRO!'=>'Uuenda PRO!-ks!','Show/hide all'=>'Näita/peida kõik','ICS file could not be retrieved or was empty. Please verify URL is correct, and check your php.ini configuration to verify either cURL or allow_url_fopen is available. If you are using spaces to delimit multiple URLs, you may also wish to try using the pipe character instead. Affected URL:'=>'ICS-faili ei saanud tuua või see oli tühi. Veenduge, et URL on õige, ja kontrollige oma php.ini konfiguratsiooni, et kontrollida, kas cURL või allow_url_fopen on saadaval. Kui kasutate tühikuid mitme URL-i piiritlemiseks, võite proovida selle asemel kasutada ka torumärki. Mõjutatud URL:','Hide past events'=>'Peida varasemad sündmused','Show past events'=>'Näita varasemaid sündmusi','Contact:'=>'Kontakt:','Resources:'=>'Ressursid:','Click for more...'=>'Klõpsake lisateabe saamiseks...','Save to your calendar'=>'Salvesta oma kalendrisse','Cancelled'=>'Tühistatud','The legacy parser option is deprecated and will be removed in a future update.'=>'Vanemuise parseri valik on aegunud ja see eemaldatakse tulevase uuendusega.','The "currentweek" shortcode attribute is deprecated. Please use view="week" in your shortcode instead.'=>'Atribuut "currentweek" on aegunud. Palun kasutage selle asemel oma lühikoodis view="week".','The "legendinline" shortcode attribute is deprecated. Please use legendstyle="inline" in your shortcode instead.'=>'Lühikoodi atribuut "legendinline" on aegunud. Palun kasutage selle asemel oma lühikoodis legendstyle="inline".','Cleared %1$s %2$s transient(s).'=>'Puhastatud %1$s %2$s transient(id).','No %1$s transients were found.'=>'Ühtegi %1$s transienti ei leitud.','Your feed URL appears to contain HTTP Basic Authentication credentials. Try turning off the %1$s option under the %2$s tab above.'=>'Teie sööda URL-aadress näib sisaldavat HTTP Basic Authentication volitusi. Proovige lülitada välja valik %1$s ülalpool vahekaardil %2$s.','Use legacy feed request method'=>'Kasutage pärimussööda taotlemise meetodit','%1$sThis URL points to a file in your Media Library.%2$s While you should be able to use this URL in an %3$s shortcode, it will be a static snapshot of the calendar at the time the file was created, and will not reflect any future updates to the source calendar. Please see our %4$sUser Guide%5$s for instructions on obtaining your correct dynamic feed URL.'=>'%1$sSee URL viitab failile teie meediaraamatukogus.%2$s Kuigi te peaksite saama seda URL-i kasutada %3$s lühikoodis, on see staatiline hetkeseade kalendrist faili loomise ajal ja ei kajasta kalendri allikasüsteemi tulevasi uuendusi. Palun vaadake meie %4$skasutusjuhendist%5$s juhiseid õige dünaamilise sööda URL-i saamiseks.','Error: Could not resolve IP address for %1$s.'=>'Viga: %1$s IP-aadressi ei õnnestunud lahendada.','Resolved IP address for %1$s:'=>'Lahendatud IP-aadress %1$s:','The text entered in the "Default shortcode" field is not a valid shortcode, and was not saved.'=>'Väljale "Vaikimisi lühikood" sisestatud tekst ei ole kehtiv lühikood ja seda ei salvestatud.','%1$sSettings updated.%2$s You may need to refresh the page to see some changes.'=>'%1$sSeaded updated.%2$s Mõne muudatuse nägemiseks peate võib-olla värskendama lehte.','calendar event'=>'kalendrisündmus','The legacy feed request method is deprecated, and will be removed in an update in the near future. Please test your feeds with the legacy feed request method turned off.'=>'Varasemate sööda taotlemise meetod on kaotanud kehtivuse ja see eemaldatakse lähitulevikus uuendusega. Palun testige oma söötasid, kui pärimusliku sööda taotlemise meetod on välja lülitatud.','Map'=>'Kaart','Recurring event'=>'Korduv sündmus','Recurs every %1$s years'=>'Kordub iga %1$s aasta tagant','Recurs yearly'=>'Kordub igal aastal','Recurs every %1$s months'=>'Kordub iga %1$s kuu tagant','Recurs monthly'=>'Kordub igakuiselt','Recurs every %1$s weeks'=>'Kordub iga %1$s nädala tagant','Recurs weekly'=>'Kordub iga nädal','Recurs every %1$s days'=>'Kordub iga %1$s päeva tagant','Recurs daily'=>'Kordub iga päev','The "url" property in your %1$s shortcode appears to contain HTML tags; most likely your URL has been turned into a clickable link. Your calendar may not display properly as a result. Please remove the clickable link in the shortcode.'=>'Teie %1$s lühikoodi "url"-omadus näib sisaldavat HTML-tähiseid; tõenäoliselt on teie URL muudetud klikitavaks lingiks. Selle tulemusena ei pruugi teie kalender korralikult kuvada. Palun eemaldage lühikoodis olev klikitav link.','The r34ics_url_get_contents() function is no longer supported.'=>'Funktsiooni r34ics_url_get_contents() enam ei toetata.','%1$sPlease note:%2$s %3$s version 10.6 changes the default options for several shortcode settings. In order to maintain consistency, these new defaults are %4$snot%5$s enabled when upgrading from an earlier version. If you would like to learn more about the changes please read our %6$sblog post%7$s, or to switch to the new defaults, turn on the %8$s option on the %9$s settings%10$s page.'=>'%1$sPane tähele:%2$s %3$s versioon 10.6 muudab mitmete lühikoodide seadete vaikimisi valikuid. Järjepidevuse säilitamiseks ei %4$s ole need uued vaikeväärtused %5$s varasemast versioonist uuendamisel lubatud. Kui soovite muudatuste kohta rohkem teada saada, lugege meie %6$sblogipostitust%7$s või lülitage uute vaikimisi väärtuste kasutamiseks sisse %8$svalik %9$sseadete%10$slehel.','Use new parameter defaults (v.10.6)'=>'Kasutage uusi parameetri vaikeväärtusi (v.10.6)','%1$sPlease note:%2$s %3$s version 11.0 streamlines the way ICS feed URLs are retrieved. This change uses a standard built-in WordPress function, so it should be fully compatible with all existing installations. If you encounter any new issues after upgrading to version 11 or later, please visit the %4$sWordPress Support Forums%5$s for assistance.'=>'%1$sPange tähele:%2$s %3$s versioon 11.0 ühtlustab ICS-i sööda URL-ide otsimise viisi. See muudatus kasutab WordPressi standardset sisseehitatud funktsiooni, nii et see peaks olema täielikult ühilduv kõigi olemasolevate paigaldustega. Kui teil tekib pärast versiooni 11 või uuema versiooni uuendamist uusi probleeme, külastage abi saamiseks %4$sWordPressi tugifoorumeid%5$s.','%1$sPlease note:%2$s %3$s version 11.5.14.2 introduces a new, more secure method for handling calendar parameters when loading via AJAX. Please clear any caching plugins you are using, to ensure that your calendars are loading properly with the new method.'=>'%1$sPange tähele:%2$s %3$s versioon 11.5.14.2 tutvustab uut, turvalisemat meetodit kalendri parameetrite käsitlemiseks AJAX-i kaudu laadimisel. Palun tühjendage kõik kasutatavad vahemälupluginad, et tagada kalendrite nõuetekohane laadimine uue meetodi abil.','Add %1$s'=>'Lisa %1$s','Close'=>'Sulge','ICS Feed URL:'=>'ICS Feed URL:','Be sure you are using a %1$ssubscribe%2$s URL, not a %3$sweb view%4$s URL.%5$s (Entering the URL directly in your web browser should download an %6$s file.)'=>'Veenduge, et kasutate %1$ssubscribe%2$s URL-i, mitte %3$sweb view%4$s URL-i.%5$s (Kui sisestate URL-i otse veebibrauserisse, peaks see alla laadima %6$s faili.)','Calendar Title:'=>'Kalendri pealkiri:','Leave empty to use calendar&rsquo;s default title. Enter %1$s to omit title altogether.'=>'Jäta tühjaks, et kasutada kalendri vaikimisi pealkirja. Sisestage %1$s, et pealkiri üldse välja jätta.','Calendar Description:'=>'Kalendri kirjeldus:','Leave empty to use calendar&rsquo;s default description. Enter %1$s to omit description altogether.'=>'Jäta tühjaks, et kasutada kalendri vaikimisi kirjeldust. Kirjutage %1$s, kui soovite kirjeldust üldse mitte kasutada.','View:'=>'Vaata:','month'=>'kuu','list'=>'loend','week'=>'nädal','Count:'=>'Krahv:','Format:'=>'Vorming:','Leave %1$s blank to include all upcoming events. %2$s must be a standard %3$sPHP date format string%4$s.'=>'Jäta %1$s tühjaks, et lisada kõik eelseisvad sündmused. %2$s peab olema standardne %3$sPHP kuupäeva formaadis string%4$s.','Show event descriptions %1$s(change to a number in inserted shortcode to set word limit)%2$s'=>'Näita sündmuse kirjeldusi %1$s(muutke sisestatud lühikoodis numbriks, et seada sõnapiirang)%2$s','Show event locations %1$s(if available)%2$s'=>'Näita sündmuste asukohti %1$s(kui on olemas)%2$s','Show event organizers %1$s(if available)%2$s'=>'Näita sündmuse korraldajaid %1$s(kui on olemas)%2$s','%1$sNote:%2$s Additional %3$sdisplay options%4$s are available by manually editing the shortcode after insertion.'=>'%1$sMärkus:%2$s Täiendavad %3$skuvamisvõimalused%4$s on saadaval lühikoodi käsitsi redigeerimisel pärast sisestamist.','Insert %1$s'=>'Sisesta %1$s','Do even more with %1$s!'=>'Tee %1$s abil veelgi rohkem!','Calendar Builder'=>'Kalendri koostaja','Configure all calendar settings with an easy visual interface... no need to manually type shortcodes.'=>'Konfigureeri kõik kalendri seaded lihtsa visuaalse kasutajaliidese abil... ei ole vaja käsitsi sisestada lühikoode.','Additional Views and Enhanced Features'=>'Täiendavad vaated ja täiustatud funktsioonid','New ways to display your calendar including Full, Up Next, Masonry, Month with Sidebar, Widget, and more. Additional capabilities are added to the core Month, Basic, List and Week views.'=>'Uued viisid kalendri kuvamiseks, sealhulgas täis, Up Next, Masonry, Month with Sidebar, Widget ja palju muud. Lisafunktsioone on lisatud põhilistele kuu-, põhi-, loendi- ja nädala vaadetele.','Customizer'=>'Kohandaja','Easily modify your calendar color palettes, fonts, and more, site-wide.'=>'Muuda hõlpsasti oma kalendri värvipalette, kirjastiile ja muud, kogu saidi ulatuses.','ICS Events'=>'ICS sündmused','%1$sNew!%2$s Turns %3$s into a full calendar system. Create and manage events directly in WordPress and even integrate them seamlessly with your existing feeds.'=>'%1$sUus!%2$s Muudab %3$s täielikuks kalendrisüsteemiks. Looge ja haldage sündmusi otse WordPressis ning integreerige need isegi sujuvalt oma olemasolevatesse kanalitesse.','Visit %1$s to learn more.'=>'Lisateabe saamiseks külastage %1$s.','Go PRO!'=>'Mine PRO!','Getting Started'=>'Alustamine','System Report'=>'Süsteemi aruanne','Save Changes'=>'Salvesta muudatused','Thank you for installing %1$s. Before creating your first calendar shortcode, please visit your %2$sGeneral Settings%3$s page and verify that your site language, timezone and date/time format settings are correct. See our %4$sUser Guide%5$s for more information.'=>'Aitäh paigaldamise eest %1$s. Enne oma esimese kalendri lühikoodi loomist külastage palun oma %2$sÜldised seaded%3$s lehte ja kontrollige, et teie saidi keel, ajavöönd ja kuupäeva/kellaajavorming oleksid õiged. Lisateavet leiate meie %4$skasutusjuhendist%5$s.','Quick Start Guide'=>'Kiirjuhend','An extensive %1$sUser Guide%2$s is available on our website. Below are some quick links to key resources in the documentation.'=>'Meie veebisaidil on saadaval põhjalik %1$skasutusjuhend%2$s. Allpool on toodud mõned kiirlinkid dokumentatsiooni peamistele allikatele.','General:'=>'Üldine:','General WordPress Settings'=>'Üldised WordPressi seaded','%1$s Settings'=>'%1$s Seadistused','Working with Shortcodes:'=>'Töötamine lühikoodidega:','Shortcode Overview'=>'Ülevaade lühikoodidest','Shortcode Builder'=>'Lühikoodide koostaja','Shortcode Parameters Reference'=>'Lühikoodi parameetrite viide','Advanced Topics:'=>'Täiustatud teemad:','FAQs and Tips'=>'KKK ja nõuanded','CSS Guide'=>'CSS juhend','Developer Resources'=>'Arendaja ressursid','GDPR'=>'GDPR','Appearance'=>'Välimus','Match calendar color palette to current Block Theme colors'=>'Sobita kalendri värvipalett praeguse Block Theme värvidega','beta'=>'beta','Replaces the %1$s default neutral color palette with nearest matches from the current Site Editor Styles color palette or the %2$s file in your theme. Color selections are algorithmic, and some combinations may not pass accessibility contrast tests. This setting has no effect if you are using a "classic" theme that does not include a %3$s file.'=>'Asendab %1$s vaikimisi neutraalse värvipaleti lähimate vastetega praegusest Site Editor Styles värvipaletist või teie teema %2$s failist. Värvivalik on algoritmiline ja mõned kombinatsioonid ei pruugi läbida ligipääsetavuse kontrasti teste. Sellel seadistusel ei ole mõju, kui kasutate "klassikalist" teemat, mis ei sisalda %3$s faili.','%1$sThis is currently a beta feature.%2$s It may require making some adjustments to your calendar settings or CSS for optimal display, especially if you have color-coded your feeds. Functionality is subject to change.'=>'%1$sSee on praegu beetafunktsioon.%2$s See võib nõuda kalendrisätete või CSSi kohandamist optimaalse kuvamise tagamiseks, eriti kui olete oma sööda värvikoodiga tähistanud. Funktsionaalsus võib muutuda.','Dark mode'=>'Tume režiim','Inverts color palette (light colors on a dark background). %1$sNote:%2$s Dark mode also automatically applies style changes similar to the %3$s and %4$s shortcode parameters, so you do not need to include them in your shortcode.'=>'Inverteerib värvipaleti (heledad värvid tumedal taustal). %1$sMärkus:%2$s Tume režiim rakendab automaatselt ka stiilimuutusi sarnaselt %3$s ja %4$s lühikoodi parameetritele, seega ei ole vaja neid oma lühikoodis lisada.','Loading'=>'Laen','Always use AJAX to render calendars (recommended)'=>'Kasutage kalendrite esitamiseks alati AJAXi (soovitatav)','When checked, all calendars will render via AJAX (asynchronously after the page loads). This is especially useful in conjunction with other caching plugins, or if your calendars contain a large number of events. Normally, calendar data is sent directly in the HTML of the initial page load unless AJAX has been specified in the shortcode.'=>'Kui see valik on märgitud, kuvatakse kõik kalendrid AJAXi kaudu (asünkroonselt pärast lehe laadimist). See on eriti kasulik koos teiste vahemälupluginatega või kui teie kalendrid sisaldavad suurt arvu sündmusi. Tavaliselt saadetakse kalendriandmed otse HTML-keeles lehekülje alglaadimisel, kui AJAXi ei ole lühikoodis määratud.','Increase memory limit when rendering calendars'=>'Suurendage kalendrite renderdamisel mälupiirangut','If your calendar is failing to load with an "out of memory" fatal error, try increasing the memory limit. A minimum of 512 MB is recommended. %1$s Notes: 1) Some hosting providers may not allow applications to override the server default setting. 2) It is not possible to set this option lower than the current default memory limit on your server.'=>'Kui teie kalendri laadimine ebaõnnestub ja ilmneb fataalne viga "mälu otsas", proovige suurendada mälupiirangut. Soovitatav on vähemalt 512 MB. %1$s Märkused: 1) Mõned veebimajutuse pakkujad ei pruugi lubada rakendustel serveri vaikimisi seadistust ületada. 2) Seda valikut ei ole võimalik seadistada madalamaks kui teie serveri praegune vaikimisi mälulimiit.','deprecated'=>'deprecated','If your site has stopped retrieving feeds after the version 11 update, turn on this option to use the legacy request method. This feature is deprecated and will be removed in an update in the near future.'=>'Kui teie sait on pärast 11. versiooni uuendamist lõpetanud söötade päringu saamise, lülitage see valik sisse, et kasutada pärimuse päringumeetodit. See funktsioon on aegunud ja see eemaldatakse lähitulevikus toimuva uuendusega.','Default shortcode'=>'Vaikimisi lühikood','If your site will include a large number of similarly configured calendar shortcodes, you can enter a default "base" shortcode here with the parameters that should be the same for all of the calendars. Individual shortcodes on the site can then include only the parameters that are unique to that calendar, as such: %1$s Any parameters included in the individual shortcode will override what is set here.'=>'Kui teie saidil on palju sarnaselt konfigureeritud kalendri lühikoode, võite sisestada siia vaikimisi "baas" lühikoodi, mille parameetrid peaksid olema kõikide kalendrite jaoks samad. Üksikud lühikoodid saidil võivad seejärel sisaldada ainult neid parameetreid, mis on selle kalendri jaoks unikaalsed: %1$s Kõik individuaalses lühikoodis sisalduvad parameetrid tühistavad siin määratud parameetrid.','Allow access to these hostnames that resolve to reserved IP addresses'=>'Lubage juurdepääs nendele hostinimedele, mis lahendatakse reserveeritud IP-aadressidele','If your calendar server is hosted on the same physical server as your website, is part of the same local network, or otherwise uses a %1$sreserved IP address%2$s, enter its hostname here to allow access. For multiple calendar servers, enter one hostname per line. See %3$sthe %4$s documentation%5$s for more information.'=>'Kui teie kalendriserver asub samas füüsilises serveris nagu teie veebisait, on osa samast kohalikust võrgust või kasutab muul viisil %1$sreserveeritud IP-aadressi%2$s, sisestage siia selle hostinimi, et võimaldada juurdepääsu. Mitme kalendriserveri puhul sisestage üks hostinimi iga rea kohta. Lisateavet leiate %3$sdokumentatsioonist %4$s%5$s.','Enter one hostname per line. Hostnames are the base domain name, not a full URL. %1$s For example, you would enter %2$s, not %3$s.'=>'Sisestage üks hostinimi rea kohta. Hostnimed on põhidomeeninimi, mitte täielik URL. %1$s Näiteks sisestage %2$s, mitte %3$s.','Caching'=>'Vahemälustamine','Transient (cache) expiration'=>'Ajutine (vahemälu) aegumine','seconds'=>'sekundit','Sets how long calendar feed data should be cached on the server (WordPress transients) before reloading. Default is 3600 (1 hour).'=>'Määrab, kui kaua kalendrisööda andmed peaksid enne uuesti laadimist serveris vahemällu salvestatud olema (WordPressi üleminekud). Vaikimisi on 3600 (1 tund).','Miscellaneous'=>'Muu','Remove "Add ICS Calendar" button in Classic Editor'=>'Eemalda nupp "Lisa ICS kalender" klassikalises redaktoris','By default, ICS Calendar adds an "Add ICS Calendar" button to the toolbar above the WYSIWYG editor when using Classic Editor. Check this box to remove the button. Has no effect on sites using the Block Editor (Gutenberg).'=>'Vaikimisi lisab ICS Calendar nupu "Lisa ICS Calendar" tööriistaribale WYSIWYG redaktori kohal, kui kasutate klassikalist redaktorit. Selle nupu eemaldamiseks märgistage see ruut. Ei mõjuta saite, mis kasutavad plokkredaktorit (Gutenberg).','%1$s version 10.6 introduced new default values for several shortcode parameters. New installations automatically use the new default values, but upgraded installations will continue to use the old default values, unless this box is checked. Read more about these changes on %2$sour blog%3$s.'=>'%1$s versioon 10.6 võttis kasutusele uued vaikeväärtused mitme lühikoodi parameetri jaoks. Uued paigaldused kasutavad automaatselt uusi vaikeväärtusi, kuid uuendatud paigaldused kasutavad jätkuvalt vanu vaikeväärtusi, kui see ruut ei ole märgitud. Lisateavet nende muudatuste kohta leiate %2$s meie blogist%3$s.','Our complete user guide is available with full translation into dozens of languages on our website:'=>'Meie täielik kasutusjuhend on saadaval koos täieliku tõlkega kümnetesse keeltesse meie veebisaidil:','For assistance, please use our %1$ssupport request form%2$s.'=>'Abi saamiseks kasutage palun meie %1$stoetustaotluse vormi%2$s.','When contacting support, please include the %1$sSystem Report%2$s from this page.'=>'Kui võtate ühendust klienditoega, lisage palun selle lehekülje %1$sSüsteemi aruanne%2$s.','Spread the word!'=>'Levitage sõna!','If you find %1$s useful, you can help support our continued growth and development with a %2$sfive-star review%3$s. Thank you!'=>'Kui leiad, et %1$s on kasulik, võid aidata toetada meie jätkuvat kasvu ja arengut %2$sviie tärni arvustusega%3$s. Aitäh!','%1$s Data Cache'=>'%1$s Andmete vahemälu','Clear Cached Calendar Data'=>'Tühjenda vahemällu talletatud kalendriandmed','This will immediately clear all existing cached calendar data (purge transients), forcing WordPress to reload all calendars the next time they are viewed. Caching will then resume as before.'=>'See kustutab kohe kõik olemasolevad vahemällu salvestatud kalendriandmed (puhastage möödujad), sundides WordPressi järgmisel vaatamisel kõik kalendrid uuesti laadima. Vahemällu salvestamine jätkub nagu varemgi.','ICS Feed URL Tester'=>'ICS-kanali URL-i tester','If you are concerned that the plugin is not properly retrieving your feed, you can test the URL here.'=>'Kui olete mures, et plugin ei too teie kanalit õigesti, saate URL-i siin testida. Allpool kuvatakse plugina saadud toorandmed.','Enter feed URL...'=>'Sisesta kanali URL...','Test URL'=>'Testi URL-i','Results:'=>'Tulemused:','%1$s received.'=>'%1$s saadud.','This appears to be a valid ICS feed URL.'=>'See näib olevat kehtiv ICS-i sööda URL.','This does not appear to be a valid ICS feed URL.'=>'See ei tundu olevat kehtiv ICS-i sööda URL.','Could not retrieve data from the requested URL.'=>'Taotletud URL-ilt ei saanud andmeid tuua.','An unknown error occurred while attempting to retrieve the requested URL.'=>'Taotletud URL-i toomise katsel ilmnes tundmatu tõrge.','Please copy the following text and include it in your message when emailing support.'=>'Kopeerige järgmine tekst ja lisage see oma sõnumisse toe meiliga saatmisel.','Also please include the %1$s shortcode exactly as you have it entered on the affected page.'=>'Palun lisage ka lühikood %1$s täpselt nii, nagu see on sisestatud mõjutatud leheküljele.','For your site security please do NOT post the System Report in the support forums.'=>'Teie saidi turvalisuse huvides palun ärge postitage süsteemiaruannet tugifoorumidesse.','No events found.'=>'Sündmusi ei leitud.','Previous Page'=>'Eelmine lk','Next Page'=>'Järgmine lk','All Day'=>'Kogu päev','Today'=>'Täna','No events.'=>'Ei mingeid sündmusi.','No additional events this month.'=>'Sel kuul lisaüritusi ei ole.','Last week'=>'Eelmisel nädalal','This week'=>'Sel nädalal','Next week'=>'Järgmisel nädalal','ICS Calendar'=>'ICS Calendar','https://icscalendar.com'=>'https://icscalendar.com','Turn your Google Calendar, Microsoft Office 365 or Apple iCloud Calendar into a seamlessly integrated, auto-updating, zero-maintenance WordPress experience.'=>'Muutke oma Google\'i kalender, Microsoft Office 365 või Apple iCloudi kalender sujuvalt integreeritud, automaatselt uuendatavaks ja hooldusvabaks WordPressi kogemuseks.','Room 34 Creative Services, LLC'=>'Room 34 Creative Services, LLC']];
